import{o as p,c as t,a}from"./app.e2261b09.js";const e='{"title":"О, наконец настал тот час","description":"","frontmatter":{"title":"О, наконец настал тот час","date":"2020/12/26 20:01:00","cover_index":"http://picsum.photos/450/450?random=50","tags":null,"categories":["aboutMe","songs"]},"relativePath":"blog/o-nakonets-nastal-tot-chas.md","lastUpdated":1628427826537}',o={},s=a("<p>О, наконец настал тот час,</p><p>Когда я здесь и вижу вас,</p><p>Едва надеясь на взаимность.</p><p>В слепом неведеньи томлюсь,</p><p>Я беспороден - это минус,</p><p>Но благороден - это плюс.</p><p>Я ради ваших глаз готов,</p><p>Сразиться с дюжиной котов,</p><p>Без колебаний в бездну ринусь.</p><p>Сгорю за вас и утоплюсь,</p><p>Меня не слышат - это минус,</p><p>Но и не гонят - это плюс.</p><p>О, наконец настал тот час,</p><p>Когда я снова вижу вас,</p><p>Уже надеясь на взаимность.</p><p>Я убедилась - вы не трус,</p><p>Вы так устали - это минус,</p><p>Но я люблю вас - это плюс.</p><p>Не разлучат нас никогда</p><p>Коты, невзгоды и года,</p><p>Я так ждала.</p><p>Я столько вынес.</p><p>Но тем прочнее наш союз,</p><p>Мы так страдали - это минус,</p><p>Теперь мы вместе - это плюс.</p>",25);o.render=function(a,e,o,n,r,_){return p(),t("div",null,[s])};export{e as __pageData,o as default};
